const { detects, faceapi } = require("./src/detections");
const base64 =
  "data:image/jpeg;base64,";

const { JSDOM } = require("jsdom");
global.window = new JSDOM("<html></html>").window;
global.document = window.document;
faceapi.env.monkeyPatch({
  Canvas: window.HTMLCanvasElement,
  Image: window.HTMLImageElement,
  createCanvasElement: () => document.createElement("canvas"),
  createImageElement: () => document.createElement("img"),
});
const path = require("path");
const modelPathRoot = "./models";
async function start() {
  const displaySize = { width: 1000, height: 1000 };
  const modelPath = path.join(__dirname, modelPathRoot);
  await faceapi.nets.ssdMobilenetv1.loadFromDisk(modelPath);
  await faceapi.nets.faceRecognitionNet.loadFromDisk(modelPath);
  await faceapi.nets.faceLandmark68Net.loadFromDisk(modelPath);
  optionsSSDMobileNet = new faceapi.SsdMobilenetv1Options({
    minConfidence: 0.5,
  });
  const img = document.createElement("img");
  img.src = base64;
  img.width = img.height = 1000;
  let detections = await faceapi
    .detectAllFaces(img, optionsSSDMobileNet)
    .withFaceLandmarks()
    .withFaceDescriptors();
  console.log("run-ahihi");
  const resizedDetections = await faceapi.resizeResults(
    detections,
    displaySize
  );
  console.log(resizedDetections);
}
start();
